		function challenge_solver() {
			try {
                var match_value = "$zeros"; 
                var challenge_token = "$token";
                var expiration = "$time"
                var i = 0;
                var hash_value = 1;
                do {
                    i++;
                    var rand_add = btoa(i);
                    var solution = challenge_token + rand_add;
	            var hash_obj = new jsSHA(solution, "TEXT");
		    hash_value = hash_obj.getHash("SHA-256","HEX");
                } while(hash_value.substring(0, match_value.length) != match_value);
                //alert(hash_value);
                //alert(solution);
                document.cookie="deflect" + "=" + solution+  "; expires="+expiration+"; path=/";
               history.back()

			} catch(e) {
				alert(e);
			}
		}
</script>
